import {getQuestions} from './../Service/QuizApi'

const Header = () => {

    useEffect(()=>{
        getQuestions();
    },[])
    return (
        <div>
            <h1>Quiz Application</h1>
            <div className='box'>
                <div>
                    <h4>Please select the difficulty level and number of questions</h4>
                </div>
            </div>
        </div>
    )
}

export default Header
